import React from 'react';
import * as S from './gallery.styles';


const Gallery = ({gallery}) => {
    return (
        <S.Gallery_Container>
            <S.Gallery_Wrapper>
                {
                    gallery.map((image , i ) => (
                        <img src="/SCContact.png" alt=""/>
                    ))
                }
            </S.Gallery_Wrapper>
        </S.Gallery_Container>
    )
}
export default Gallery;
